@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ATM a owl:Class .
:Account a owl:Class .
:Bank a owl:Class .
:CashCard a owl:Class .
:Customer a owl:Class .
:Withdrawal a owl:Class .

:ownsCard a owl:ObjectProperty ;
    rdfs:domain :Customer ;
    rdfs:range :CashCard .

:belongsToBank a owl:ObjectProperty ;
    rdfs:domain :ATM ;
    rdfs:range :Bank .

:hasAccount a owl:ObjectProperty ;
    rdfs:domain :Customer ;
    rdfs:range :Account .

:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain :CashCard ;
    rdfs:range :Bank .

:WithdrawalLimit a owl:DatatypeProperty ;
    rdfs:domain :Account ;
    rdfs:range xsd:decimal .

:RequestedAmount a owl:DatatypeProperty ;
    rdfs:domain :Withdrawal ;
    rdfs:range xsd:decimal .

:TransactionFail a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty :RequestedAmount ;
        owl:someValuesFrom [
            a owl:Restriction ;
            owl:onProperty owl:greaterThan ;
            owl:someValuesFrom :WithdrawalLimit
        ]
    ] .
